import React from "react";

export default function Footer() {
    return(
        <div id="footer">
            <input className="inputName" placeholder="Name..." type="text" />
            <input className="inputNumber" placeholder="Number..." type="number" />
            <div id="btn">Add new contact</div>
        </div>
    )   
}
